import React from 'react'
import { Link } from 'react-router-dom';
import "./Header.css"
const Header = () => {
  return (
    <div className='nav'>
        <div className='navleft'>
            <Link ><img className='logo_img' alt='cant load image' src="https://upload.wikimedia.org/wikipedia/commons/thumb/6/69/IMDB_Logo_2016.svg/2560px-IMDB_Logo_2016.svg.png"></img></Link>
            <Link style={{textDecoration:"none"}}>Top Rated</Link>
            <Link style={{textDecoration:"none"}}>Popular</Link>
            <Link v>Upcoming</Link>
        </div>
    </div>
  )
}

export default Header;
